Popeye The Sailor - All Cartoon TV SERIES on one Pack


Popeye cartoons were not just on the television on the cartoon network channel or the teletubbies but after a lot of fame and name, Popeye cartoons started getting published even as strips in the journals and newspapers like the New York Journal. Soon, Popeye cartoons were published as comic strips in many famous newspapers as well. The name of this Popeye cartoons strip was Thimble Theater, which was because the classic cartoon characters acted the stories in a more of theatrical manner. It would be a matter of shock for the viewers and fans to know that Popeye cartoons never had Popey as the main cartoon character. Initially, in the strips, the main classic cartoon characters were Olive Oyl and her boyfriend named Harold Hamgravy and not Popey. Then Olive OylÃƒÂ¢Ã¢â€šÂ¬Ã¢â€žÂ¢s brother came into the picture by the name Castor Oyl and OliveÃƒÂ¢Ã¢â€šÂ¬Ã¢â€žÂ¢s parents name Cole Oyl and Nana Oyl. Till almost 10 years, this classic cartoon continued as it was with Harold Hamgravy but then came the hero, the Popey. This classic cartoon character gained so much of fame that he was given a larger role than the main character of Harold. With time, Popey replaced Harold. The Popeye cartoons showed that Olive Oyl left Harold and started dating Popey with which his role could be expanded now. As everyone say this was done just to expand the cartoon.

